import React from "react";
import Img from '../user.png'

const User = ({ user }) => {
    return (
        <div className="user_wrapper">
            <div className="user_info">
                <div className="user_detail">
                    <img src={user.avatar || Img} alt="avatar" />
                </div>
            </div>
        </div>
    )
}

export default User;
